export default function ItemList({
category,
  notebookProduct,
  desktopProduct,
}) {
    // console.log(notebookProduct);
    // console.log(desktopProduct)
  return (
    <div>
      {(category == "notebook") ? (

       <h1>{notebookProduct}</h1>)
       : (
       <h1>{JSON.parse(desktopProduct)}</h1>
      )}
    </div>
  );
}
